def countSmaller(nums):
    def sort(enum):
        half = len(enum) // 2
        if half:
            left, right = sort(enum[:half]), sort(enum[half:])
            for i in range(len(enum))[::-1]:
                if not right or left and left[-1][1] > right[-1][1]:
                    smaller[left[-1][0]] += len(right)
                    enum[i] = left.pop()
                else:
                    enum[i] = right.pop()
        return enum

    smaller = [0] * len(nums)
    sort(list(enumerate(nums)))
    return smaller


def countSmaller1(nums):
    if not nums:
        return None
        # 1. 遍历nums
        # 2. 遍历nums[i+1:]，找比nums[i]小的元素，并计数
    n = len(nums)
    counts = [0] * n  # 初始化一个0数组
    for i in range(n - 1):
        for num in nums[i + 1:]:
            if nums[i] > num:
                counts[i] += 1
    return counts


